#include <bits/stdc++.h>

template<std::size_t S>
void printArr(std::array<int, S> arr)
{
    std::cout << "{" << arr[0];
    for (long i = 1; i < (long)S; i++)
    {
        std::cout << "," << arr[i];
    }
    std::cout << "}" << std::endl;
}

template<std::size_t S>
long long solve(std::array<int, S> input) {
    printArr(input);
    long long ans = 0;
    for (long i = 0; i < (long)S; i++)
    {
        std::unordered_set<int> appeared = std::unordered_set<int>();
        std::unordered_set<int> problems = std::unordered_set<int>();
        for (long j = i; j >= 0; j--)
        {
            if (appeared.find(input[j]) == appeared.end())
            {
                appeared.insert(input[j]);
            }
            else
            {
                auto it = problems.find(input[j]);
                if (it == problems.end()) problems.insert(input[j]);
                else problems.erase(it);
            }
            if (problems.empty())
            {
                ans += 1;
            }
        }
        //std::cout << ans << std::endl;
    }

    return ans;
}

template<std::size_t S>
void test(std::array<int, S> arr, int ans)
{
    std::cout << solve(arr) << " = " << ans << std::endl;
}

